_rules: !!python/tuple
- !ProximateTagsRule
  conditions:
  - [1, 2, DT]
  description: WDT -> IN if the tag of words i+1...i+2 is 'DT'
  original: WDT
  replacement: IN
- !ProximateWordsRule
  conditions:
  - [1, 1, well]
  description: IN -> RB if the text of the following word is 'well'
  original: IN
  replacement: RB
- !ProximateTagsRule
  conditions:
  - [-1, -1, NN]
  - [1, 1, NNP]
  description: WDT -> IN if the tag of the preceding word is 'NN', and the tag of
    the following word is 'NNP'
  original: WDT
  replacement: IN
- !ProximateTagsRule
  conditions:
  - [1, 2, NNS]
  description: WDT -> IN if the tag of words i+1...i+2 is 'NNS'
  original: WDT
  replacement: IN
- !ProximateTagsRule
  conditions:
  - [-1, -1, NN]
  - [1, 1, PRP]
  description: WDT -> IN if the tag of the preceding word is 'NN', and the tag of
    the following word is 'PRP'
  original: WDT
  replacement: IN
- !ProximateTagsRule
  conditions:
  - [1, 1, ',']
  description: IN -> RB if the tag of the following word is ','
  original: IN
  replacement: RB
- !ProximateTagsRule
  conditions:
  - [1, 3, PRP]
  description: JJR -> RBR if the tag of words i+1...i+3 is 'PRP'
  original: JJR
  replacement: RBR
- !ProximateTagsRule
  conditions:
  - [1, 3, VBG]
  description: WDT -> IN if the tag of words i+1...i+3 is 'VBG'
  original: WDT
  replacement: IN
- !ProximateTagsRule
  conditions:
  - [1, 1, NN]
  description: RBR -> JJR if the tag of the following word is 'NN'
  original: RBR
  replacement: JJR
- !ProximateTagsRule
  conditions:
  - [1, 1, NNS]
  description: RBR -> JJR if the tag of the following word is 'NNS'
  original: RBR
  replacement: JJR
- !ProximateWordsRule
  conditions:
  - [-1, -1, month]
